<script>
function normalizeGlyphs() {
  const cells = document.querySelectorAll('.cell');
  const svgs = document.querySelectorAll('.cell svg');
  
  // 모든 SVG의 실제 경계 계산
  let maxWidth = 0;
  let maxHeight = 0;
  
  const bounds = [];
  
  svgs.forEach(svg => {
    const bbox = svg.getBBox();
    bounds.push(bbox);
    maxWidth = Math.max(maxWidth, bbox.width);
    maxHeight = Math.max(maxHeight, bbox.height);
  });
  
  // 가장 큰 차원을 기준으로 설정
  const maxDimension = Math.max(maxWidth, maxHeight);
  const padding = maxDimension * 0.05; // 5% 패딩
  const viewBoxSize = maxDimension + padding * 2;
  
  // 각 SVG를 동일한 viewBox로 재설정
  svgs.forEach((svg, index) => {
    const bbox = bounds[index];
    const centerX = bbox.x + bbox.width / 2;
    const centerY = bbox.y + bbox.height / 2;
    
    const newViewBoxX = centerX - viewBoxSize / 2;
    const newViewBoxY = centerY - viewBoxSize / 2;
    
    svg.setAttribute('viewBox', `${newViewBoxX} ${newViewBoxY} ${viewBoxSize} ${viewBoxSize}`);
  });
}

// SVG가 로드된 후 실행
if (document.readyState === 'loading') {
  document.addEventListener('DOMContentLoaded', normalizeGlyphs);
} else {
  normalizeGlyphs();
}
</script>
